import React from 'react'
import './clusterMessage.component.scss'
import Button from '../button/button.component'
import { motion } from "framer-motion"

export default function ClusterMessage(props) {
    const variants = {
        initial: { opacity: 0, y: 100 },
        actual: { opacity: 1, y: 0 },
        transition: { 
            ease: "easeOut", 
            staggerChildren: 0.5 
        }
    }

    return (
        <motion.div className="cluster-message" style={props.style}>
            <motion.h1 initial="initial" animate="actual" variants={variants}>materiale de contructii, gradinarit & bricolaj</motion.h1>
            <motion.p initial="initial" animate="actual" variants={variants} transition={{ ease: "easeOut", duration: 0.5 }}>Nu ai gasit ce cautai?</motion.p>
            <motion.p initial="initial" animate="actual" variants={variants} transition={{ ease: "easeOut", duration: 0.5 }}>Preluam si comenzi speciale</motion.p>
            <motion.p initial="initial" animate="actual" variants={variants} transition={{ ease: "easeOut", duration: 0.5 }}>Apeleaza-ne la 0732 409 095</motion.p>
            <Button/>
        </motion.div>
    )
}
